import './ExpenseItem.css';

function ExpenseItem(props){
    const expense_date= new Date(2021,2,28);
    const expense_title= 'Car Insurance';
    const expense_amount= 294.67;

    this.props.map(el=>
        {
            return (
                <div class="expense-item">
                    <div>{expense_date.toDateString()}</div>
                    <div class="expense-item__description">
                        <h2>{expense_title}</h2>
                        <div class="expense-item__price">${expense_amount}</div>
                    </div>
                    
                </div>
            )
        }

    )
   
}

export default ExpenseItem;
